❗️ Ночное выступление Зеленского, основные тезисы:

– За обстрел Харькова РФ ждет Гаагский трибунал;
– Зеленский еще раз призвал закрыть полеты для РФ, закрыть доступ к портам, каналам, аэропортам во всем мире.;
– Президент перечислил имена и подвиги украинских военных, которые предстали перед наградой, включая посмертные;
– Киев - ключевая цель. Столица под угрозой, цель РФ – уничтожить украинскую государственность;
– Первый раунд переговоров. Переговоры шли под бомбардировкой наших городов. Была синхронизация переговоров и военных действий;
– Украину не устраивают переговоры во время обстрелов;
– Сегодня была подписана заявка на вступление Украины в ЕС и направлена в Брюссель. "Время пришло".

